//SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract TokenBank is ERC20{

    address public owner;
    mapping(address => uint256) public banlance;

    event Deposit(address indexed user,uint256 amount);

    event Withdraw(address indexed user,uint256 amount);


    constructor() ERC20("aweiToken","camp"){
        _mint(msg.sender,10000*10**18);
        owner = msg.sender;
        
    }

    function deposit(uint value) public payable{

        // 确保存款金额大于0
        require(value > 0, "Amount must be greater than 0");
        bool success = transferFrom(msg.sender, address(this), value);
        require(success,"token transfer failed");
        banlance[msg.sender] += value;
        emit Deposit(msg.sender, value);
        
    }

    function withdraw(uint256 value) public {
        // 确保取款金额大于0
        require(value > 0, "Amount must be greater than 0");
        banlance[msg.sender] -= value;
        bool success = transfer(msg.sender,value);
        require(success,"token transfer failed");

        emit Withdraw(msg.sender,value);
    }
    
}

